import React from 'react';

const Button = () => {
    return (
        <>
            <section className="Button">
                <h1>Say Hello to ReactJS</h1>
                <p>Lore ipsum test</p>
                <button>Awesome</button>
            </section>
        </>
    )
}

export default Button
